<template>
  <div class="test2">
    <el-main>
      <p>
        基于Bister and Emanuel 2002的热带气旋分析
      </p>
      <blockquote>
        Bister and Emanuel 2002,简称BE02。是一种由Emanuel与Bister在2002年提出，
        由海面温度，海面平均气压，含压，温度，混合比来计算出热带气旋的潜在强度(PI)的算法。
      </blockquote>
      <p>
        使用说明：在此上传相关的气象文件.nc，之后此页面会出现相关领域的PI强度图。
      </p>
      <el-upload style="margin-left:14%;margin-top:5%"
                 class="avatar-uploader el-upload--text"
                 :drag="Plus"
                 multiple
                 :headers="headers"
                 :show-file-list="false"
                 :data="{SavePath: this.Path.url}"
                 :on-success="handleVideoSuccess"
                 :before-upload="beforeUploadFile"
                 :on-progress="uploadFileProcess"
                 :http-request="uploadSectionFile"
                 :action="url"
      >
        <i v-if="Plus" class="el-icon-upload"></i>
        <div v-if="Plus" class="el-upload__text">将文件拖到此处，或<em>点击上传</em></div>
        <el-progress v-if="videoFlag == true" type="circle" :percentage="parseInt(videoUploadPercent)"
                     style="margin-top:30px;"></el-progress>
        <div class="el-upload__tip" slot="tip">只能上传.nc文件，且不超过300M</div>
      </el-upload>
      <el-image v-if="pictureSrc !== undefined" :src="pictureSrc"></el-image>
    </el-main>
  </div>
</template>

<script>
import {getToken} from "../../utils/auth";
import axios from 'axios'

export default {
  name: 'weather-predict',
  data() {
    return {
      pictureSrc: undefined,
      url: 'dev-api/weather/predict',
      videoForm: {
        videoId: '',
        videoUrl: ''
      },
      videoFlag: false,
      headers: {Authorization: "Bearer " + getToken()},
      Plus: true,
      Path: {
        url: 'F:/video/videoUpload'
      },
      videoUploadPercent: 0
    }
  },
  mounted: function () {
  },
  methods: {
    // 视频上传前执行
    beforeUploadFile(file) {
      const isLt300M = file.size / 1024 / 1024 < 300
      console.log(file.type)
      var fileType = file.name.substring(file.name.lastIndexOf('.') + 1)
      if (fileType != 'nc') {
        console.log(file.type)
        this.$message.error('请上传正确的文件格式')
        return false
      }
      if (!isLt300M) {
        this.$message.error('上传文件大小不能超过300MB哦!')
        return false
      }
    },
    // 视频上传过程中执行
    uploadFileProcess(event, file, fileList) {
      this.Plus = false
      this.videoFlag = true
      this.videoUploadPercent = file.percentage.toFixed(0)
    },
    // 上传成功是时执行
    handleVideoSuccess(res, file) {
      this.Plus = false
      this.videoUploadPercent = 100
      console.log(res)
      // 如果为200代表视频保存成功
      if (res.code = 200) {
        // 接收视频传回来的名称和保存地址
        // 至于怎么使用看你啦~
        this.$message.success('分析完成！')
      } else {
        this.$message.error('文件上传失败，请重新上传！')
      }
    },
    uploadSectionFile(params) {
      let form = new FormData()
      console.log(params)
      form.append('file', params.file)
      axios.post(`dev-api/weather/predict`, form, {responseType: "arraybuffer", headers: this.headers})
        .then((res) => {
          if (res.code = 200) {
            this.$message.success('分析完成！')
            // this.pictureSrc = 'data:image/jpeg;base64,' + this.arrayBufferToBase64(res.data)
            this.pictureSrc = 'data:image/jpg;base64,'
          } else {
            this.$message.error('文件上传失败，请重新上传！')
          }
        }).catch((res) => {
        console.log(res);
      });

    },
    arrayBufferToBase64(buffer) {
      var binary = ''
      var bytes = new Uint8Array(buffer)
      var len = bytes.byteLength
      for (var i = 0; i < len; i++) {
        binary += String.fromCharCode(bytes[i])
      }
      return window.btoa(binary)
    },

  }
}
</script>
